const initialState = {
   data: [],
   loading: false,

};
export default function reducer(state = initialState, action) {
   switch (action.type) {
       case 'LOAD_USERS_LOADING': {
           return {
               ...state,
               loading: true,
            };
       }
       case 'LOAD_USERS_SUCCESS': {
           return {
               ...state,
               data: action.json,
               loading: false
           }
       }
       
       default: {
           return state;
       }
   }
}
